DROP VIEW IF EXISTS `v_users`;
CREATE ALGORITHM=UNDEFINED DEFINER=`default`@`%` SQL SECURITY DEFINER VIEW `v_users` AS select `u`.`id` AS `id`,`u`.`name` AS `name`,`u`.`phone` AS `phone`,`i`.`real_name` AS `real_name`,`i`.`city` AS `city`,`i`.`head` AS `head` from (`users` `u` join `user_infos` `i` on((`u`.`id` = `i`.`uid`)));

